  constructor(props) {
    super(props)
    this.state = {
      text: ""
    }
  }
  // shouldComponentUpdate = shouldPureComponentUpdate;

  render() {
    return (
       <div style={greatPlaceStyle}>
          {this.props.text}
       </div>
    );
  }
}
